import React from "react";
import TrainingTableRowInput from './TrainingTableRowInput';
import TrainingTableRowButton from './TrainingTableRowButton';

const TrainingTableRow = ({ index, set, openModal, handleUpdateSet, handleRemoveSet }) => {
  return (
    <tr>
      <td>{index + 1}</td>
      <TrainingTableRowInput index={index} set={set} openModal={openModal} />
      <td>
        <TrainingTableRowButton index={index} set={set} handleUpdateSet={handleUpdateSet} handleRemoveSet={handleRemoveSet} />
      </td>
    </tr>
  );
};

export default TrainingTableRow;
